function autocompleteVue(e){function getCategories(item){if(item.SearchType=="Category")return item}function getBrands(item){if(item.SearchType=="Brand")return item}function getBlog(item){if(item.SearchType=="Blog")return item}function getProducts(item){if(item.SearchType=="Product")return item}clearTimeout(delayTimer);delayTimer=setTimeout(function(){var value,category,searchResult;e.checkValidity()?(searchResult=document.getElementById("adv_search"),searchResult&&e.value!=""&&(searchResult.style.display="block"),value=e.value,category="",document.getElementById("SearchCategoryId")&&(category=document.getElementById("SearchCategoryId").value),axios({url:"/catalog/searchtermautocomplete",method:"get",params:{term:value,categoryId:category}}).then(function(response){if(response.data){vm.searchitems=response.data;var categories=response.data.map(getCategories).filter(function(element){return element!==undefined}),brands=response.data.map(getBrands).filter(function(element){return element!==undefined}),blog=response.data.map(getBlog).filter(function(element){return element!==undefined}),products=response.data.map(getProducts).filter(function(element){return element!==undefined});vm.searchcategories=categories;vm.searchbrands=brands;vm.searchblog=blog;vm.searchproducts=products}})):(searchResult=document.getElementById("adv_search"),searchResult&&(searchResult.style.display="none"))},600)}var delayTimer;